include "workflows.php";
error_reporting(0);

$wf = new Workflows();

//
// Get the date as Y-M-D
//

$raw = "{query}";
$parts = explode("-",$raw);

switch(count($parts)) {
	case 1: {
		$year = intval($parts[0]);
		$cyear = intval(date("Y"));
		if (($year > $cyear)||($year == 0)) {
			$year = $cyear;
		}
		$line = sprintf("%04d",$year);
		$wf->result($count, "$line-", "What Year? $year", '', 'icon.png', 'no', "$line-");
		break;
	}

	case 2: {
		$year = intval($parts[0]);
		$month = intval($parts[1]);
		$cmonth = intval(date("m"));
		if (($month > 12)||($month < 1)) {
			$month = $cmonth;
		}
		$line = sprintf("%04d",$year) . "-" . sprintf("%02d",$month);
		$wf->result($count, "$line-", "What Month? $month", '', 'icon.png', 'no', "$line-");
		break;
	}

	case 3: {
		//
		// Make sure the day is correct.
		//
		$year = intval($parts[0]);
		$month = intval($parts[1]);
		$day = intval($parts[2]);
		if(($day < 1)||($day>31)) {
			$day = "01";
		}

		$line = sprintf("%04d",$year) . "-" . sprintf("%02d",$month) . "-" . sprintf("%02d",$day);
		$wf->result($count, "$line", "What Day? $day", '', 'icon.png', 'yes', "$line");
		break;
	}
}

echo $wf->toxml();

